import React from 'react';
import logo from './logo.svg';
import './App.css';
import Technologies from './Technologies';
import Sidebar from './sideber';

const App = () => {
  return (
    <div>
      <header>
        <img src='./../public/karman.png'></img>
      </header>
      <Technologies />
      <Sidebar />
    </div>
  );
}
export default App;
